function LandingPage() {
    return (
      <div className="App">
          <img src={MYtineraryLogo} className="Mytinerary-logo" alt="logo" />
          <p className="TagLine">Find your perfect trip, designed by insiders who know and love their cities.</p>
      </div>
    );
  }

